import React from 'react';
import TaskCard from './TaskCard';

export default class DillyDally extends React.Component{
  constructor(props){
    super(props)
    this.state = {
      tasks: []
    };
  }

  componentDidMount(){
    fetch('/tasks',{
      method:'GET'
    })
    .then(response => {this.setState({
      tasks : response,
    })
  })
  }
  render(){
    return(

      <div className={'task'}>
        <TaskCard />
        {this.tasks}
      </div>
    )
  }
}
